import { option } from "vis-util/esnext";

//selection dropdown menu to select algorithm
export default function AlgorithmSelector (props) {
    const {algos = [{label:"Depth First Search",value:"DFS"},{label:"Breadth First Search",value:"BFS"}]} = props
    // algos = ["DFS", "BFS"]
    const view = <div>
        <label> Select an algorithm 
            <select value={props.value} onChange={props.onChange}>
                {algos.map((option) => (
                    <option value={option}>{option}</option>
                ))}
            </select>
        </label>
    </div>

    return view;
};
